import { findByLabelText } from "@testing-library/react";
import React from "react";
import { Link, useNavigate } from "react-router-dom";

export default function Header( { text } ) {


    const navigate = useNavigate();

    const headerStyle = {
        display: 'flex',
        justifyContent: 'space-between'
    }

    const buttonStyle = {
        fontSize: '24px',
        backgroundColor: '#80a1e8',
        color: 'black',
        margin: 15,
        fontFamily: 'Helvetica',
        borderRadius: 8,
        padding: 8
    }

    const logout = () => {
        navigate('/judge-manager/auth');
    };

    return (
        <div>
        <header style={headerStyle}>
        <div>
            <button style={buttonStyle} onClick={() => navigate('/judge-manager/app')}>Home</button>
            <button style={buttonStyle} onClick={() => navigate(`/judge-manager/app/${text.toLowerCase()}`)}>{text}</button>
        </div>
        <div>
            <button style={buttonStyle} onClick={logout}>Logout</button>
        </div>
    </header>
    </div>
    );

}
